INSERT INTO `text` VALUES (1,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(2,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n** helppage|help\n* Semantic Tools\n** Special:ARC2Admin|ARC2 Admin\n** Special:RDFImport|RDF Import\n** Special:SPARQLEndpoint|SPARQL Endpoint\n* SEARCH\n* TOOLBOX\n* LANGUAGES','utf-8'),(3,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n** helppage|help\n* Semantic Tools\n** Special:ARC2Admin|ARC2 Admin\n** Special:RDFImport|RDF Import\n** Special:SPARQLEndpoint|SPARQL Endpoint\n** Special:SPARQLImport|SPARQL Import\n* SEARCH\n* TOOLBOX\n* LANGUAGES','utf-8');
